import { useState } from "react";

export const useFetchGifs = () => {
  const [state, setState] = useState({
    data: [],
    loading: true,
  });
  setTimeout(() => {
    setState({
      data: [],
      loading: true,
    });
  }, 2000);

  return state; // { data:[], loading: true};
};
